elvetica, Arial, sans-serif;","font-size":"1.1em"},"text":"&lt;h3&gt;Approach:&lt;/h3&gt;\n&lt;ul&gt;\n  &lt;li&gt;Reasonable data-preprocessing technologies, such as &lt;b&gt;feature engineering, missing value handling...&lt;/b&gt;&lt;/li&gt;\n  &lt;li&gt;Compare various regression models' performances, such as &lt;b&gt;LightGBM, XGboost... &lt;/b&gt;&lt;/li&gt;\n  &lt;li&gt;Based on the optimal model, conduct analysis and get better visualization.&lt;/li&gt;\n&lt;/ul&gt; \n&lt;p1&gt;Total of &lt;b&gt;450 samples&lt;/b&gt; analysed.&lt;/p1&gt;"},"id":"1006","type":"Div"},{"attributes":{},"id":"1114","type":"DataRange1d"},{"attributes":{"margin":[5,5,5,5],"sizing_mode":"stretch_width","style":{"font-family":"Helvetica Neue, Helvetica, Arial, sans-serif;","font-size":"1.1em"},"text":"&lt;p1&gt;Housing is the most basic demand for human beings, which is closely related to people's daily life. In this project, we use different features of houses, such as house type, building year, house area, decoration, and other influencing factors to establish a specific house price prediction model. By forecasting housing prices, the government can better judge the\ndirection of social development. Also, by effectively predicting housing prices, private investors can have a better grasp of the market, and accurately understand the impact of housing factors on housing prices, so as to make decoration or purchase choices.\n&lt;/p1&gt;"},"id":"1005","type":"Div"},{"attributes":{"index":9,"label":{"value":"1251800.0~1430000.0"},"renderers":[{"id":"1152"}]},"id":"1169","type":"LegendItem"},{"attributes":{"high":9,"low":0,"palette":["#1f77b4","#aec7e8","#ff7f0e","#ffbb78","#2ca02c","#98df8a","#d62728","#ff9896","#9467bd","#c5b0d5"]},"id":"1108","type":"LinearColorMapper"},{"attributes":{"index":5,"label":{"value":"1034000.0~1251800.0"},"renderers":[{"id":"1152"}]},"id":"1168","type":"LegendItem"},{"attributes":{"callback":null,"names":["patches"],"point_policy":"follow_mouse","tooltips":
